int InputNOAAOI2SSTGridStream::read(unsigned char *buffer,size_t buffer_length)
{
  char line[256];
  int numBytes,bytesRead=0;

  if (!fs.is_open()) {
    std::cerr << "Error: no open stream" << std::endl;
    exit(1);
  }
  fs.getline(line,256);
  if (fs.eof()) {
    return bfstream::eof;
  }
  else if (!fs.good()) {
    return bfstream::error;
  }
  numBytes=0;
  while (line[numBytes] != 0xa) {
    ++numBytes;
  }
  if (numBytes != 45) {
    std::cerr << "Error reading grid header" << std::endl;
    exit(1);
  }
  while (1) {
    if ( static_cast<size_t>(bytesRead+numBytes) > buffer_length) {
	std::cerr << "buffer overflow" << std::endl;
	exit(1);
    }
    std::copy(&line[0],&line[numBytes],&buffer[bytesRead]);
    bytesRead+=numBytes;
    fs.getline(line,256);
    if (!fs.good()) {
	break;
    }
    numBytes=0;
    while (line[numBytes] != 0xa) {
	++numBytes;
    }
    if (numBytes == 45) {
	fs.seekg(-(numBytes+1),std::ios_base::cur);
	break;
    }
  }
  ++num_read;
  return bytesRead;
}

